import './App.css';
import React from 'react';

class App extends React.Component {
  constructor() {
    super();

    this.handleClick = this.handleClick.bind(this);
  }

  handleClick() {
    return console.log('Boa tarde galerinha do mal!');
  }

  render() {
    return (
      <button onClick={this.handleClick}>Boa tardee</button>
    );
  }
}

export default App;
